class=\"blocks-gallery-item\"><figure><img src=\"http://127.0.0.1/wp-content/uploads/2019/09/download-3.jpeg\" alt=\"\" data-id=\"29\" data-link=\"http://127.0.0.1/?attachment_id=29\" class=\"wp-image-29\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://127.0.0.1/wp-content/uploads/2019/09/download-1-1.jpeg\" alt=\"\" data-id=\"30\" data-link=\"http://127.0.0.1/?attachment_id=30\" class=\"wp-image-30\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://127.0.0.1/wp-content/uploads/2019/09/download-2-1.jpeg\" alt=\"\" data-id=\"31\" data-link=\"http://127.0.0.1/?attachment_id=31\" class=\"wp-image-31\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://127.0.0.1/wp-content/uploads/2019/09/download-3-1.jpeg\" alt=\"\" data-id=\"32\" data-link=\"http://127.0.0.1/?attachment_id=32\" class=\"wp-image-32\"/></figure></li></ul>\n<!-- /wp:gallery --></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns -->','YOUR HOME\'S','','inherit','closed','closed','','26-revision-v1','','','2019-09-20 07:39:54','2019-09-20 07:39:54','',26,'http://127.0.0.1/index.php/2019/09/20/26-revision-v1/',0,'revision','',0),(34,1,'2019-09-20 07:42:09','2019-09-20 07:42:09','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://127.0.0.1/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','inherit','closed','closed','','2-revision-v1','','','2019-09-20 07:42:09','2019-09-20 07:42:09','',2,'http://127.0.0.1/index.php/2019/09/20/2-revision-v1/',0,'revision','',0),(35,1,'2019-09-20 07:42:13','2019-09-20 07:42:13','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Our website address is: http://127.0.0.1.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What personal data we collect and why we collect it</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comments</h3><!-- /wp:heading --><!-- wp:paragraph --><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contact forms</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Embedded content from other websites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analytics</h3><!-- /wp:heading --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Your contact information</h2><!-- /wp:heading --><!-- wp:heading --><h2>Additional information</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>How we protect your data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What data breach procedures we have in place</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What third parties we receive data from</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What automated decision making and/or profiling we do with user data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Industry regulatory disclosure requirements</h3><!-- /wp:heading -->','Privacy Policy','','inherit','closed','closed','','3-revision-v1','','','2019-09-20 07:42:13','2019-09-20 07:42:13','',3,'http://127.0.0.1/index.php/2019/09/20/3-revision-v1/',0,'revision','',0),(36,1,'2019-09-20 07:44:29','2019-09-20 07:44:29','{\n    \"zerif-lite::zerif_bigtitle_redbutton_url\": {\n        \"value\": \"http://127.0.0.1/index.php/your-homes/\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-09-20 07:44:29\"\n    }\n}','','','trash','closed','closed','','7810170d-75f6-4bfb-ae5e-22e78b6bc30e','','','2019-09-20 07:44:29','2019-09-20 07:44:29','',0,'http://127.0.0.1/index.php/2019/09/20/7810170d-75f6-4bfb-ae5e-22e78b6bc30e/',0,'customize_changeset','',0),(37,1,'2019-09-20 08:06:30','2019-09-20 08:06:30','{\n    \"widget_ctup-ads-widget[1]\": {\n        \"value\": {\n            \"encoded_serialized_instance\": \"\",\n            \"title\": \"QUALITY\",\n            \"is_widget_customizer_js_value\": true,\n            \"instance_hash_key\": \"b92c5b74555ed4306eecf349637c82bd\"\n        },\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-09-20 08:00:50\"\n    },\n    \"zerif-lite::zerif_ourfocus_subtitle\": {\n        \"value\": \"\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-09-20 08:00:50\"\n    },\n    \"widget_ctup-ads-widget[2]\": {\n        \"value\": {\n            \"encoded_serialized_instance\": \"\",\n            \"title\": \"Timely Delivery\",\n            \"is_widget_customizer_js_value\": true,\n            \"instance_hash_key\": \"91d7f91bebed49034f80ba24d7f53fae\"\n        },\n        \"type\": \"opti